fr:mainmatter.fr:p:
Let V be a monoidal category. A V-functor C\xrightarrow {F} D between V-categories C and D consists of the following data:
for each object x\in C, an object Fx\in D;
for each pair of objects x, y\in C, a morphism F_{x,y}: C(x, y)\to D(Fx, Fy) in V.

This data must preserve composition and identities, in that 




